pragma solidity ^0.4.24;
import "./FoodSupplyChain.sol";
import "./SupplyChainUser.sol";

contract FoodSupplyChainShipingLogistic{

    FoodSupplyChain foodSupplyChain;
    SupplyChainUser supplyChainUser;
    address public lastAccess;

    constructor(address _foodSupplyChain,address _supplyChainUser) public{
        foodSupplyChain = FoodSupplyChain(_foodSupplyChain);
        supplyChainUser = SupplyChainUser(_supplyChainUser);
    } 

    event DoneExporting(address indexed user, address indexed batchNo);
    event DoneCarrying(address indexed user, address indexed batchNo);
    event DoneDistribution(address indexed user, address indexed batchNo);
    event DoneProcessing(address indexed user, address indexed batchNo);
    event DoneRetailing(address indexed user, address indexed batchNo);

    modifier isValidPerformer(address batchNo, string role) {
        require(keccak256(abi.encodePacked(supplyChainUser.getUserRole(msg.sender))) == keccak256(abi.encodePacked(role)));
        require(keccak256(abi.encodePacked(foodSupplyChain.getNextAction(batchNo))) == keccak256(abi.encodePacked(role)));
        _;
    }

    struct exporter {
        string exporterDetail;
        string packageDetail;
        string destinationAddress;
        string shipID;
        uint256 quantity;
        uint256 loadingDateTime;
    }

    struct carrier{
        string carrierName;
        string carrierNo;
        string shipmentID;
        string maintainedTemperature;
        string maintainedHumidity;
        uint256 shipmentDateTime;
    }

    struct distributor{
        string certificateID;
        string warehouseName;
        string warehouseAddress;
        string storageTemperature;
        string storageHumidity;
        string packagingDetail;
        uint256 quantity;
    }

    struct processor {
        string processorName;
        string temperature;
        string internalBatchNo;
        string packageName;
        string packageAddress;
        uint256 processingDateTime;
    }

    struct retailer {
        string packageID;
        uint256 expiryDate;
        string temperature;
    }

    mapping (address => exporter) batchExporter;
    mapping (address => carrier) batchCarrier;
    mapping (address => distributor) batchDistributor;
    mapping (address => processor) batchProcessor;
    mapping (address => retailer) batchRetailer;

    exporter exporterData;
    carrier carrierData;
    distributor distributorData;
    processor processorData; 
    retailer retailerData;

     /*get Exporter data*/
    function getExporterData(address batchNo) public view returns(string exporterDetail,
                                                            string packageDetail,
                                                            string destinationAddress,
                                                            string shipID,
                                                            uint256 quantity,
                                                            uint256 loadingDateTime){

        exporter memory tmpData = batchExporter[batchNo];


        return (tmpData.exporterDetail, 
                tmpData.packageDetail, 
                tmpData.destinationAddress, 
                tmpData.shipID, 
                tmpData.quantity, 
                tmpData.loadingDateTime);
    }


    /* perform Export */
    function updateExporterData(address _batchNo,
                                string _exporterDetail,
                                string _packageDetail,
                                string _destinationAddress,
                                string _shipID,
                                uint256 _quantity,
                                uint256 _loadingDateTime) 
                                public isValidPerformer(_batchNo,'EXPORTER') returns(bool) {

        exporterData.exporterDetail = _exporterDetail;
        exporterData.packageDetail = _packageDetail;
        exporterData.destinationAddress = _destinationAddress;
        exporterData.shipID = _shipID;
        exporterData.quantity = _quantity;
        exporterData.loadingDateTime = _loadingDateTime;

        batchExporter[_batchNo] = exporterData;

        foodSupplyChain.setNextAction(_batchNo,'CARRIER');

        emit DoneExporting(msg.sender, _batchNo);
        return true;
    }

    /*get Carrier data*/
    function getCarrierData(address batchNo) public view returns(string carrierName,
                                                           string carrierNo,
                                                           string shipmentID,
                                                           string maintainedTemperature,
                                                           string maintainedHumidity,
                                                           uint256 shipmentDateTime){

        carrier memory tmpData = batchCarrier[batchNo];


        return (tmpData.carrierName,
                tmpData.carrierNo,
                tmpData.shipmentID, 
                tmpData.maintainedTemperature, 
                tmpData.maintainedHumidity, 
                tmpData.shipmentDateTime);

    }

    /* perform Carrier */
    function updateCarrierData(address _batchNo,
                              string _carrierName,
                              string _carrierNo,    
                              string _shipmentID,
                              string _maintainedTemperature,
                              string _maintainedHumidity,
                              uint256 _shipmentDateTime) 
                                public isValidPerformer(_batchNo,'CARRIER') returns(bool) {

        carrierData.carrierName = _carrierName;
        carrierData.carrierNo = _carrierNo;
        carrierData.shipmentID = _shipmentID;
        carrierData.maintainedTemperature = _maintainedTemperature;
        carrierData.maintainedHumidity = _maintainedHumidity;
        carrierData.shipmentDateTime = _shipmentDateTime;

        batchCarrier[_batchNo] = carrierData;

        foodSupplyChain.setNextAction(_batchNo,'DISTRIBUTOR'); 

        emit DoneCarrying(msg.sender, _batchNo);
        return true;
    }

    /* get Distributor */
    function getDistributorData(address batchNo) public view returns (string certificateID,
                                                                string warehouseName,
                                                                string warehouseAddress,
                                                                string storageTemperature,
                                                                string storageHumidity,
                                                                string packagingDetail,
                                                                uint256 quantity) {
        distributor memory tmpData = batchDistributor[batchNo];


        return (tmpData.certificateID, 
                tmpData.warehouseName, 
                tmpData.warehouseAddress,
                tmpData.storageTemperature,
                tmpData.storageHumidity,
                tmpData.packagingDetail,
                tmpData.quantity);

    }

    /* perform Distribution */
    function updateDistributorData(address _batchNo,
                                    string _certificateID,
                                    string _warehouseName,
                                    string _warehouseAddress,
                                    string _storageTemperature,
                                    string _storageHumidity,
                                    string _packagingDetail,
                                    uint256 _quantity) public isValidPerformer(_batchNo,'DISTRIBUTOR') returns(bool) {

        distributorData.certificateID = _certificateID;
        distributorData.warehouseName = _warehouseName;
        distributorData.warehouseAddress = _warehouseAddress;
        distributorData.storageTemperature = _storageTemperature;
        distributorData.storageHumidity = _storageHumidity;
        distributorData.packagingDetail = _packagingDetail;
        distributorData.quantity = _quantity;

        batchDistributor[_batchNo] = distributorData;

        foodSupplyChain.setNextAction(_batchNo,'PROCESSOR'); 

        emit DoneDistribution(msg.sender, _batchNo);
        return true;
    }

    /* get Processor */
    function getProcessorData(address batchNo) public view returns (string processorName, 
                                                                string temperature,
                                                                string internalBatchNo,
                                                                string packageName,
                                                                string packageAddress,
                                                                uint256 processingDateTime) {
        processor memory tmpData = batchProcessor[batchNo];


        return (
                tmpData.processorName, 
                tmpData.temperature, 
                tmpData.internalBatchNo, 
                tmpData.packageName,
                tmpData.packageAddress,
                tmpData.processingDateTime);

    }

     /* perform Processing */
    function updateProcessorData(address _batchNo,
                                 string _processorName, 
                                 string _temperature,
                                 string _internalBatchNo,
                                 string _packageName,
                                 string _packageAddress,
                                 uint256 _processingDateTime) public isValidPerformer(_batchNo,'PROCESSOR') returns(bool) {

        processorData.processorName = _processorName;
        processorData.temperature = _temperature;
        processorData.internalBatchNo = _internalBatchNo;
        processorData.packageName = _packageName;
        processorData.packageAddress = _packageAddress;
        processorData.processingDateTime = _processingDateTime;

        batchProcessor[_batchNo] = processorData;

        foodSupplyChain.setNextAction(_batchNo,'RETAILER');   

        emit DoneProcessing(msg.sender, _batchNo);
        return true;
    }

    /*get Retailer data*/
    function getRetailerData(address batchNo) public view returns(string packageID, 
                                                              string temperature,
                                                              uint256 expiryDate){

        retailer memory tmpData = batchRetailer[batchNo];


        return (
                tmpData.packageID, 
                tmpData.temperature, 
                tmpData.expiryDate);


    }

    /* perform Retailer */
    function updateRetailerData(address _batchNo,
                                 string _packageID,
                                 string _temperature,
                                 uint256 _expiryDate) public isValidPerformer(_batchNo,'RETAILER') returns(bool) {

        retailerData.packageID = _packageID;
        retailerData.temperature = _temperature;
        retailerData.expiryDate = _expiryDate;

        batchRetailer[_batchNo] = retailerData;

        foodSupplyChain.setNextAction(_batchNo,'DONE');  

        emit DoneRetailing(msg.sender, _batchNo);
        return true;
    }
}
